webpackJsonp([49853112519812],{9084:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Second Day with McCafé",date:"02 Dec 2007",slug:"/2007-12-02-second-day-with-mccaf/",tags:"Y2007"},html:'<p><a href="http://www.flickr.com/photos/papascott/2080031357/" title="CIMG0362 by PapaScott, on Flickr"><img src="https://farm3.static.flickr.com/2264/2080031357_3d08fa71cf.jpg" width="500" height="375" alt="CIMG0362" /></a></p>\n<p>We were so busy yesterday that we forgot to take pictures, but here\'s a set at Flickr with some outdoor and indoor views of our new look: <a href="http://www.flickr.com/photos/papascott/sets/72157603355394867/">Second Day with McCaf&eacute;</a>.</p>\n<p><iframe align="center" src="http://www.flickr.com/slideShow/index.gne?set_id=72157603355394867" frameBorder="0" "width=500" height="500" scrolling="no"></p>'},next:{fields:{title:"We're the Kids in US-America (oh-oh)",date:"01 Dec 2007",slug:"/2007-12-01-were-the-kids-in-us-america-oh-oh/"}},previous:{fields:{title:"Open Glühwein Club",date:"03 Dec 2007",slug:"/2007-12-03-open-gluehwein-club/"}}},{node:{fields:{title:"We're the Kids in US-America (oh-oh)",date:"01 Dec 2007",slug:"/2007-12-01-were-the-kids-in-us-america-oh-oh/",tags:"Y2007"},html:'<p>For those with an fetish for <a href="http://www.papascott.de/archives/2007/11/16/is-ami-an-insult/">whipping an expired stallion</a>, Scot W. Stevenson (of <a href="http://usaerklaert.wordpress.com/">USA Erkl&auml;rt</a>)  has posted an updated text (in German, outside of his blog) <a href="http://www.possum.in-berlin.de/texts/us-amerikanisch.html">against the term "US-amerikanisch"</a>. I don\'t have much to add, except that maybe that the Spanish and Portuguese residents of the Americas also do not refer to themselves as "Americanos", and that a <a href="http://www.youtube.com/watch?v=-hWZqllm3mQ">musical reference to Kim Wilde</a> is missing. A gratuitous reference to the <a href="http://www.msnbc.msn.com/id/16389973/">poor knowledge in Germany of geography outside of Europe</a> would also be cute.</p>'},next:{fields:{title:"We Knew You'd Be Coming So We Baked A Cake",date:"30 Nov 2007",slug:"/2007-11-30-we-knew-youd-be-coming-so-we-baked-a-cake/"}},previous:{fields:{title:"Second Day with McCafé",date:"02 Dec 2007",slug:"/2007-12-02-second-day-with-mccaf/"}}},{node:{fields:{title:"We Knew You'd Be Coming So We Baked A Cake",date:"30 Nov 2007",slug:"/2007-11-30-we-knew-youd-be-coming-so-we-baked-a-cake/",tags:"Y2007"},html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2007/11/mccafe-gutschein.jpg" alt="mccafe_gutschein.jpg" border="0" width="403" height="275" /></p>\n<p>A coupon for a free piece of apple or cherry-yoghurt cake with purchase of a tall cappuccino good until 31 January. </p>'},next:{fields:{title:"T Minus 6 Hours",date:"30 Nov 2007",slug:"/2007-11-30-t-minus-6-hours/"}},previous:{fields:{title:"We're the Kids in US-America (oh-oh)",date:"01 Dec 2007",slug:"/2007-12-01-were-the-kids-in-us-america-oh-oh/"}}}],pathPrefix:"",first:!1,last:!1,index:94,pageCount:1101}}}});
